import React from 'react';
import {useQuery} from '@apollo/react-hooks';
import gql from 'graphql-tag';

const MY_PRODUCTS = gql`
  query MY_PRODUCTS {
      user{
        id
        username
        email
        products{
          id
        }
        carts{
          id
          product{
            name
            price
            imageUrl
          }
          qualtity
        }
      }
    }

`


const UserProducts = () => {
  return (
    <div>
      User Products
    </div>
  )
}

export default UserProducts
